import React from "react";
import { TextInput } from "../../components/TextInput";
import "./Profile.css";

function Profile(props) {
  return (
    <div className="profile">
      <header className="profile-header">
        <span className="avatar">JR</span>
        <h3 className="profile-name-location">
          <span className="profile-name">Joe Root</span>
          <span className="profile-location">San Francisco, CA</span>
        </h3>
      </header>
      <form className="profile-main">
        <TextInput type="email" label="Email address" name="emailInput" value="asdf@gmail.com" placeholder="Enter your email here" onChange={()=>{}} />
      </form>
    </div>
  );
}

export default Profile;
